import { useState, useEffect } from 'react';

const CourseList = () => {
    const [courses, setCourses] = useState([])

    useEffect(()=> {
        fetch('/api/courses')
            .then((res) => res.json())
            .then((data) => {
                setCourses(data)
            })
            .catch((error) => console.error(error))
    }, [])

    return (
        <div>
            <h1>Course List</h1> 
            <ul>
                <li>Title: Sample Course Title</li>
                <li>Description: This is a description.</li>
                <li>Instructor: Jared</li>
                <li>Duration: 8</li>
                <li>availableSlots: 100</li>
            </ul>
        </div>
    )
}

export default CourseList;
